import React from "react";
import { makeStyles } from "@material-ui/core/styles";

const useStyles = makeStyles((theme) => ({
  root: {
    minHeight: "100vh",
  },
}));

function Home() {
  return (
    <div>
      <h1>Home Page</h1>
      <Link to="/mapbox">
        <i className="material-icons backtext">Home</i>
      </Link>
    </div>
  );
}

export default Home;
